def lengthOfLongestSubstring(s):
    max_n = 0
    rez = []
    #print(list(range(1, len(set(s)) + 1)[::-1]), len(set(s)))
    if len(set(s)) < 2:
        return len(set(s))
    else:
        while len(rez) < 10:
            for i in range(1, len(set(s)) + 1)[::-1]:
                if len(rez) > 10:
                    break
                else:
                    last = len(s)
                    width = i
                    c_last = width
                    c_first = 0
                    while c_last < last + 1 or len(rez) > 2:
                        if sorted(s[c_first:c_last]) == sorted(set(s[c_first:c_last])):
                            if max_n < len(s[c_first:c_last]):
                                rez.append(len(s[c_first:c_last]))
                            #print(len(rez))
                        c_first += 1
                        c_last += 1
                        if len(rez) > 2:
                            break
        #else break
    return max(rez)


